import Button from '@material-ui/core/Button';
import {Link} from "react-router-dom";


const CardButton = ({text,color}) => {
    return (
        <>
        <Link to="/add" style={{width:'100%' , margin: '0 auto', display: "flex"}}>
            <Button color={color} style={{width:'100%' , margin: '0 auto', display: "flex"}}>
                {text}
            </Button>
        </Link>
        </>
    )
}

CardButton.defaultProps = {
    color: 'primary',
    text: 'Mygtukas',
    size: 'large',
  }

export default CardButton
